e150a39a-9ce0-49af-b72c-eab45b74baf3	\N	Four years ago, we were asking what is AI and why is it relevant?	2025-08-05 12:51:44.85217	\N	./storage/presentations/73c2d245-4814-478c-859d-7fb0203487b8/slides/slide-23.png	EXTRACTED	23	\N	2025-08-05 12:53:08.558714	\N	73c2d245-4814-478c-859d-7fb0203487b8	Four years ago, we were asking what is AI and why is it relevant?	Jannis: \nAs this were before LLMs and generative AI became part of our everyday language \n\n– Understanding AI was still something that most of us needed to learn \n\n– and more important understanding why it was and still is an important topic in our industry.	Statement - midnight black	2025-08-05 12:52:55.176376	1920	1080	COMPLETED	\N	\N
5bba76a8-1b58-40ee-b6c5-ef967672d576	\N	2021\nWhy use AI/MT in language services?\n\nDo we still need human translators?\n\nWhat can we use AI/MT for?	2025-08-05 12:51:44.852487	\N	./storage/presentations/73c2d245-4814-478c-859d-7fb0203487b8/slides/slide-24.png	EXTRACTED	24	\N	2025-08-05 12:53:08.558929	\N	73c2d245-4814-478c-859d-7fb0203487b8	2021\nWhy use AI/MT in language services?\n\nDo we still need human translators?\n\nWhat can we use AI/MT for?	Jannis: \nTherefore the discussions we had at the time and the questions we asked, where also reflecting that. So as you might see a lot has happened in four years. \n\nBack then we discussed the benefits of applying AI/MT in translation and localization such as:\nIncreased efficiency\nFaster translation processes\nCost optimization of translation budgets\n\nAnd the big questions were often times – What about the Quality? Will it be good enough if we use MT? Does it mean we do not need humans-in-the-loop? Etc.\n\nWe discussed what and where and we apply AI and MT: \nAt this point in time the majority of translation were still done by humans without MT involved – but Post Edited Machine Translation were on its rise\n\nNow let’s have a look at where we are today	Section - orange 	2025-08-05 12:52:55.34798	1920	1080	COMPLETED	\N	\N
