10aa68df-a542-43be-a786-3aaa2a97855e	\N	26\nThe industry has moved beyond asking “Should we use AI?” to “How do we scale and optimize AI in our operations?”\n40%\nof Enterprises now use AI for multilingual content generation\nAI has reached operational maturity\n98%\nof Enterprise expect AI \nintegration in a TMS\nSource: Slator 2025	2025-08-05 12:51:44.853377	\N	./storage/presentations/73c2d245-4814-478c-859d-7fb0203487b8/slides/slide-26.png	EXTRACTED	26	\N	2025-08-05 12:53:08.5596	\N	73c2d245-4814-478c-859d-7fb0203487b8	26\nThe industry has moved beyond asking “Should we use AI?” to “How do we scale and optimize AI in our operations?”\n40%\nof Enterprises now use AI for multilingual content generation\nAI has reached operational maturity\n98%\nof Enterprise expect AI \nintegration in a TMS\nSource: Slator 2025	Jannis: \nIt is not only in the household ChatGPT has become Operational it is also in the localisation industry. \n\n40% of Enterprises use AI in their content generation\nWe had a customer from the Retail industry that went fully on the Generative AI wave and translated their entire website using Generative AI and Machine Translation without any humans-in-the-loop to validate quality – Then they put it on their website explitcly “This website has been translated by AI, so you might get a laugh”.\nNot necessarily something we recommend to do, it fitted their brand well to do it, and therefore they went for it\n\nAs AI becomes more normal the expectations also increase to have it integrated in Translation Management Systems.	Vertical split page - orange.	2025-08-05 12:52:55.613923	1920	1080	COMPLETED	\N	\N
