eb555597-ff07-4248-9812-356bf1d098a2	\N	That was a short look at AI in the Language Industry. Now, how does the AI landscape look for you?	2025-08-05 12:51:44.859369	\N	./storage/presentations/73c2d245-4814-478c-859d-7fb0203487b8/slides/slide-35.png	EXTRACTED	35	\N	2025-08-05 12:53:08.561507	\N	73c2d245-4814-478c-859d-7fb0203487b8	That was a short look at AI in the Language Industry. Now, how does the AI landscape look for you?	Jannis: \nYou've heard how we see the market. Now we want to understand how it looks from your side: \nNow We Want to Hear From You\nWhere are you with AI today?\nWhat are your top priorities, blockers, or areas of confusion?\nWhat would make the biggest difference right now?\n\nThese are all questions we hope to get your input on in the breakouts- and with that, let’s more to our first breakout session for today	Statement - midnight black	2025-08-05 12:52:56.634045	1920	1080	COMPLETED	\N	\N
cb10b5f1-5a0b-4e00-9de1-cb275b91c973	\N	Time for our first breakout!\n20 mins	2025-08-05 12:51:44.859617	\N	./storage/presentations/73c2d245-4814-478c-859d-7fb0203487b8/slides/slide-36.png	EXTRACTED	36	\N	2025-08-05 12:53:08.56171	\N	73c2d245-4814-478c-859d-7fb0203487b8	Time for our first breakout!\n20 mins	Line: \nThank you so much Jannis for the great fly-in\n\nNow, onto our first breakout session for today. \n\nOur returning customers know the drill, but I will run through how it works for our first time participants.\n\nThis breakout session will last 20 minutes. You’ll be divided into 3 groups, each with 2 facilitators from LanguageWire there to guide conversation. \n\nThe focus of this breakout will primarily be to get to know each other/hear from one other and to understand your current AI usage and level of adaption. What does you reality currently looks like with AI.\n\nTo get started, let’s kick it off with a quick poll question:\nWhere are you today with AI in your organization?\nOptions:\n🟡 Exploring – We’re learning, but not yet testing AI\n🔵 Experimenting – We’re testing AI in isolated use cases or pilots\n🟢 Integrating – We’re applying AI in production \n🟣 Scaling – AI is part of our core processes and strategy across teams\n🔘 Cautious – We’re not using AI yet, due to risk, compliance or uncertainty\n\n-Comment on results- let’s follow-up on this conversation in your breakouts: \n\nOn the practical side, you will be automatically divided into these groups so you don't need to do anything- just sit back and wait the 10 seconds to be sent out. And then once you return back from your groups, facilitators will share learnings in plenum.\n\nWe will notify you when there is 5 mins left in the breakout and. See you back here in 20 mins! Enjoy getting to know each other!\n-Ted sends them to breakouts	Chapter - white 	2025-08-05 12:52:57.072657	1920	1080	COMPLETED	\N	\N
