3db9eb25-32d5-4505-a708-bca00fc0d689	\N	Real-world example of an Agent​\nWhat is the difference between agent and workflow?\n1\n2\n3\n4	2025-08-05 12:51:44.877536	\N	./storage/presentations/73c2d245-4814-478c-859d-7fb0203487b8/slides/slide-44.png	EXTRACTED	44	\N	2025-08-05 12:53:08.564113	\N	73c2d245-4814-478c-859d-7fb0203487b8	Real-world example of an Agent​\nWhat is the difference between agent and workflow?\n1\n2\n3\n4	This is an example of an invoice assistant agent that runs through an outlook mailbox to and onedrive to look for invoices, something I built in n8n.  It figures out the invoice data and then matches payment records in a database for invoice reconciliation.\nAgent definition – the brains with the prompts of the agent\nLLM – model executing the prompt, doing the reasoning and tool calling \nThe available tools that interact with the existing IT systems \nThe memory – kind of an intermediate clipboard to pass data between the different building blocks from step to step\n\nDifference with workflow:\nIt’s non-deterministic, never follows exaclty the same path\nLooks at the data, makes decisions, tries to recover from errors, decideds when ready eytc\nDificult rules to maintain – we don’t code rules (or at least not difficult ones), we express intent in the prompt.  The model will figure it out\nUnstructured data – documents in different format, layouts, let the llm make sense of it.\n\n===> these characteristics are typical for many workflows in localisation!! Great match so lets say how we can use agents in a language context	Split page - midnight black 	2025-08-05 12:52:58.893312	1920	1080	COMPLETED	\N	\N
