b03a0039-b979-4350-822a-afc6d23a936f	\N	We’re experimenting with multi-agent MT, fully integrated in the our TMS​\n1\n2\n3\n4	2025-08-05 12:51:44.878479	\N	./storage/presentations/73c2d245-4814-478c-859d-7fb0203487b8/slides/slide-46.png	EXTRACTED	46	\N	2025-08-05 12:53:08.564562	\N	73c2d245-4814-478c-859d-7fb0203487b8	We’re experimenting with multi-agent MT, fully integrated in the our TMS​\n1\n2\n3\n4	So how do we want to do this?​\nA multi-agent setup with different roles​\nFully integrated in our TMS, so it’s available everywhere (projects, LWT, connectors, …) and fully transparent for the user​\n​\nSchematic overview of multi-agent setup​\nOrchestrator – main agent, organizes the work of the other agents which are connected as tools. Will also use other tools from our tech platform e.g. document transfomers etc. Triggered by e.g. project creation​\nContext collector – connects to the project and establishes a context via tools that connect to the platform (not shown here for sake of simplicity): briefing on how to translate, which tone of voice, searches for examples of similar content and its translations in the LW project repo, looks at past quality issues to avoid repeating similar mistakes etc and packs this in the context​\nTranslator – gets the context, connects to platform with other tools, e.g. TBMS services, nextgen MT service, …​\nReviewer – gets the context and the MT, reviews if the MT is compliant, creates report with issues, and passes everything back up to the orchestrator​\nOrchestrator: looks at the contenxt, MT; QA report and decides what to do. In case we need to improve: gives new context (information about QA issues), calls translator agent for alternative translation, QA review and so on until the agent happy or the maximum inference cap has been reached​\n​	Split page - midnight black. 	2025-08-05 12:52:59.122092	1920	1080	COMPLETED	\N	\N
