68d31ac1-4f9a-48a3-bc82-ee3c95bcc008	\N	AI quality estimation and AI editing explained	2025-08-05 12:51:44.895885	\N	./storage/presentations/73c2d245-4814-478c-859d-7fb0203487b8/slides/slide-55.png	EXTRACTED	55	\N	2025-08-05 12:53:08.566589	\N	73c2d245-4814-478c-859d-7fb0203487b8	AI quality estimation and AI editing explained	AI QUALITY ESTIMATION (MTQE)\n\nOur new AI Quality Estimation is an innovative technology that evaluates Machine Translation without the need for human references. It uses advanced algorithms or LLMs (Large Language Models) to assess the source text and its translation, providing a confidence score for quality (ranging from 0 to 1). The score determines which segments are locked in (ready to use as-is) and which require post-editing, allowing experts and linguists to prioritise their efforts in our Post-Editing of Machine Translation workflows.\n\nAI Editing (APE)\n\nOur new AI Editing is the “error fixer” for machine-translated content. It uses LLMs to enhance output quality by automatically correcting flagged errors, reducing manual effort and delivering better results with minimal human intervention. This technology boosts Machine Translation quality and complements AI Quality Estimation (MTQE) by reducing the time and effort required for post-editing.	Title page 	2025-08-05 12:53:01.183772	1920	1080	COMPLETED	\N	\N
f8a490e4-7a60-4364-be0c-6843bf828d4b	\N	How AI quality estimation and AI editing work	2025-08-05 12:51:44.896604	\N	./storage/presentations/73c2d245-4814-478c-859d-7fb0203487b8/slides/slide-56.png	EXTRACTED	56	\N	2025-08-05 12:53:08.566786	\N	73c2d245-4814-478c-859d-7fb0203487b8	How AI quality estimation and AI editing work	Roeland:	Title 	2025-08-05 12:53:01.29952	1920	1080	COMPLETED	\N	\N
614cb86a-afa2-4136-909d-73307365537e	\N	AI Quality Estimation (MTQE) for fully managed solution\nAI Editing (APE) for MT in all use cases\nAI Quality Estimation (MTQE) For Own your Workflow	2025-08-05 12:51:44.898235	\N	./storage/presentations/73c2d245-4814-478c-859d-7fb0203487b8/slides/slide-57.png	EXTRACTED	57	AI quality estimation and AI editing significantly improve content quality at reduced time and cost	2025-08-05 12:53:08.566976	\N	73c2d245-4814-478c-859d-7fb0203487b8	AI Quality Estimation (MTQE) for fully managed solution\nAI Editing (APE) for MT in all use cases\nAI Quality Estimation (MTQE) For Own your Workflow	AI Quality Estimation (MTQE) For Fully Managed Solution\n\nBy implementing AI Quality Estimation in PEMT workflows, manual effort from linguists and experts is reduced by prioritising which segments of customer content require post-editing (lowering operational costs). This targeted approach leads to greater efficiency, and ultimately, significant cost savings for customers\n\nAI Quality Estimation (MTQE) For Own your Workflow\n\n\nBy implementing AI Quality Estimation in BYOT workflows, users can scale quality assessment in less time by automatically identifying which content segments require post-editing in our Smart Editor CAT tool. This focused approach speeds up turnaround time by allowing customers’ own linguists and experts to concentrate only on the segments that truly need attention.\n\nAI Editing (APE) for MT\nIn all Use Cases\n\n\nBy leveraging the power of Large Language Models (LLMs) to automatically enhance the initial machine translated content, users will be able to achieve better quality and readability without human intervention.\n\nA new feature that will enhance and complement AI Quality Estimation in PEMT and BYOT Workflows	Title page 	2025-08-05 12:53:01.399476	1920	1080	COMPLETED	\N	\N
