1de46c0a-4a7f-4323-8bfb-347ea9d32b06	\N	AI quality estimation and AI editing explained\nAI Editing (APE)\n\nOur new AI Editing is the “error fixer” for machine-translated content. It uses LLMs to enhance output quality by automatically correcting flagged errors, reducing manual effort and delivering better results with minimal human intervention. This technology boosts Machine Translation quality and complements AI Quality Estimation (MTQE) by reducing the time and effort required for post-editing.\nAI QUALITY ESTIMATION (MTQE)\n\nOur new AI Quality Estimation is an innovative technology that evaluates Machine Translation without the need for human references. It uses advanced algorithms or LLMs (Large Language Models) to assess the source text and its translation, providing a confidence score for quality (ranging from 0 to 1). The score determines which segments are locked in (ready to use as-is) and which require post-editing, allowing experts and linguists to prioritise their efforts in our Post-Editing of Machine Translation workflows.\nText + icons	2025-08-05 12:51:44.923448	\N	./storage/presentations/73c2d245-4814-478c-859d-7fb0203487b8/slides/slide-72.png	EXTRACTED	72	WIP	2025-08-05 12:53:08.570686	\N	73c2d245-4814-478c-859d-7fb0203487b8	AI quality estimation and AI editing explained\nAI Editing (APE)\n\nOur new AI Editing is the “error fixer” for machine-translated content. It uses LLMs to enhance output quality by automatically correcting flagged errors, reducing manual effort and delivering better results with minimal human intervention. This technology boosts Machine Translation quality and complements AI Quality Estimation (MTQE) by reducing the time and effort required for post-editing.\nAI QUALITY ESTIMATION (MTQE)\n\nOur new AI Quality Estimation is an innovative technology that evaluates Machine Translation without the need for human references. It uses advanced algorithms or LLMs (Large Language Models) to assess the source text and its translation, providing a confidence score for quality (ranging from 0 to 1). The score determines which segments are locked in (ready to use as-is) and which require post-editing, allowing experts and linguists to prioritise their efforts in our Post-Editing of Machine Translation workflows.\nText + icons	Roeland:	Title 	2025-08-05 12:53:05.942314	1920	1080	COMPLETED	\N	\N
1e2b402b-44ff-4aa3-a0d6-48b4da867134	\N	AI quality estimation and AI editing provide significant benefits for our customers\nAI Quality Estimation (MTQE) For Fully Managed Solution\n\nBy implementing AI Quality Estimation in PEMT workflows, manual effort from linguists and experts is reduced by prioritising which segments of customer content require post-editing (lowering operational costs). This targeted approach leads to greater efficiency, and ultimately, significant cost savings for customers\nAI Editing (APE) for MT\nIn all Use Cases\n\n\nBy leveraging the power of Large Language Models (LLMs) to automatically enhance the initial machine translated content, users will be able to achieve better quality and readability without human intervention.\n\nA new feature that will enhance and complement AI Quality Estimation in PEMT and BYOT Workflows\nAI Quality Estimation (MTQE) For Own your Workflow\n\n\nBy implementing AI Quality Estimation in BYOT workflows, users can scale quality assessment in less time by automatically identifying which content segments require post-editing in our Smart Editor CAT tool. This focused approach speeds up turnaround time by allowing customers’ own linguists and experts to concentrate only on the segments that truly need attention.\nCustomers WON'T SEE scores or locked segments – just savings\nVendors and Customers linguists WILL SEE scores and locked segments\nFlagged errors will be automatically edited in MT Job Types\nText + icons + animation\nHeadline customer focused\nAI quality estimation and AI editing provide quality xxx – customer centric	2025-08-05 12:51:44.924086	\N	./storage/presentations/73c2d245-4814-478c-859d-7fb0203487b8/slides/slide-73.png	EXTRACTED	73	WIP	2025-08-05 12:53:08.571045	\N	73c2d245-4814-478c-859d-7fb0203487b8	AI quality estimation and AI editing provide significant benefits for our customers\nAI Quality Estimation (MTQE) For Fully Managed Solution\n\nBy implementing AI Quality Estimation in PEMT workflows, manual effort from linguists and experts is reduced by prioritising which segments of customer content require post-editing (lowering operational costs). This targeted approach leads to greater efficiency, and ultimately, significant cost savings for customers\nAI Editing (APE) for MT\nIn all Use Cases\n\n\nBy leveraging the power of Large Language Models (LLMs) to automatically enhance the initial machine translated content, users will be able to achieve better quality and readability without human intervention.\n\nA new feature that will enhance and complement AI Quality Estimation in PEMT and BYOT Workflows\nAI Quality Estimation (MTQE) For Own your Workflow\n\n\nBy implementing AI Quality Estimation in BYOT workflows, users can scale quality assessment in less time by automatically identifying which content segments require post-editing in our Smart Editor CAT tool. This focused approach speeds up turnaround time by allowing customers’ own linguists and experts to concentrate only on the segments that truly need attention.\nCustomers WON'T SEE scores or locked segments – just savings\nVendors and Customers linguists WILL SEE scores and locked segments\nFlagged errors will be automatically edited in MT Job Types\nText + icons + animation\nHeadline customer focused\nAI quality estimation and AI editing provide quality xxx – customer centric	Roeland:	Title 	2025-08-05 12:53:06.134012	1920	1080	COMPLETED	\N	\N
