ios\nBelief v2\nSourced human expert with workflow automation\nBelief v4\nSourced human expert, automation, TMs and machine translation\nBelief v5\nBulk of translations done by tech only, no human interaction anymore\nBelief v1\nWork done by sourced human expert\nMain idea: LSP manages a community of experts and organizes the translation work with them – cheaper and more efficient than what customers con do themselves.\nMain idea: using GenAI and fuzzy, agentic workflows in combination with linguistic assets like TM, TB and document context, machine translation will be good enough for 90% of the content, with human in the loop work going to zero\nMain idea: we keep working with a community of linguistic experts but we automated all repetitive tasks and orchestrate the process execution on a platform with a strong workflow engine\nMain idea: the role of the human translator is changing to a verification role.  There are no “translations from scratch” anymore, everything is pre-filled either by TM or machine translations\nBelief v3\nSourced human expert, automation and translation memories\nMain idea: we continue with the setup we had before, but we add translation memory technologies so we can leverage previously translated documents – improving productivity and consistency, ultimately with a big price redution\n2005\n2010\n2018\n2024\n2000	\N	Default	2025-08-05 14:29:46.472843	1920	1080	COMPLETED	\N	\N
